// app/javascript/routes.js
import React from 'react';
import {
  Switch,
  Route,
} from "react-router-dom";
import HelloWorld from './bundles/HelloWorld/components/HelloWorld';
import Posts from './bundles/tests/index';
import PostDetails from './bundles/tests/TesttDetails';
import CreatePost from './bundles/tests/CreateTest';
import UpdatePost from './bundles/tests/UpdateTest';

export default () => {
  return (
    <Switch>
      <Route exact path="/">
        <Posts />
      </Route>
      <Route
        path="/posts/new"
        exact
        component={CreatePost}
       />
      <Route
        path="/posts/:id"
        exact
        component={PostDetails}
       />
      <Route
        path="/posts/:id/edit"
        exact
        component={UpdatePost}
       />
    </Switch>
  );
}
